import React from 'react'
import './App.css'
import { Route, Routes } from 'react-router-dom';
import { Box } from '@mui/material';

const App = () => {
  return (
    <Box width="400px">
      <Routes>
        <Route />
      </Routes>
    </Box>
  )
}

export default App
